1cecb2dc-e743-4cf2-a9c4-1e5992298846	About Hum's Pizza	Giới Thiệu Hum's Pizza	Where handcrafted Italian pizza meets the warm Vietnamese soul, creating memorable experiences for every family through delicious food and dedicated service.	Nơi pizza thủ công gặp gỡ linh hồn Việt Nam, tạo nên những kỷ niệm ấm áp cho mọi gia đình thông qua món ăn ngon và dịch vụ tận tâm.	Our Story	Câu Chuyện Của Chúng Tôi	Hum's Pizza began from a small shop in Binh Duong, where everything is built with passion and dedication to the craft. Our team not only learned traditional Italian pizza techniques from Chicago or Italy, but also spent time researching old recipes to perfect flavors that perfectly blend with Vietnamese tastes.\n\nFrom the beginning, our team was committed to using high-quality ingredients so customers can feel the difference and easily distinguish the characteristics of each pizza. Never stopping at just one delicious pizza, Hum's Pizza aspires to become a place where every customer can enjoy a complete culinary experience.	Hum's Pizza bắt đầu từ một cửa hàng nhỏ tại Bình Dương, nơi mọi thứ được xây dựng từ sự đam mê và tình thần thủ công. Đội ngũ không chỉ học hỏi kỹ thuật làm pizza truyền thống từ Chicago hay Ý, mà còn dành thời gian nghiên cứu để điều chỉnh hương vị phù hợp với khẩu vị người Việt.\n\nTừ phần sốt, lớp nhân cho đến cách phục vụ đều được cân nhắc kỹ lưỡng để khách hàng cảm thấy gần gũi và dễ thưởng thức. Không dừng ở chỉ là một chiếc pizza ngon, Hum's Pizza còn mong muốn trở thành điểm dừng chân lý tưởng.	/objects/images/3f3dda6f-6ace-4409-ab01-c58b16f3d0ad	/objects/images/10433267-1d6e-4bcf-b55f-8475230b673e	10+	10K+	100%	98%	Special Pizza Recipes	Công Thức Pizza Đặc Biệt	Handcrafted Pizzas Served	Pizza Thủ Công Đã Phục Vụ	Fresh Dough Daily	Bột Pizza Tươi Mỗi Ngày	Customer Satisfaction	Khách Hàng Hài Lòng	Vision	Tầm Nhìn	Hum's Pizza wants to build a chain of Vietnamese pizza restaurants, achieving international standards but still maintaining the essence of traditional Vietnamese culture and cuisine	Hum's Pizza muốn xây dựng một chuỗi nhà hàng pizza của người Việt, đạt tiêu chuẩn quốc tế nhưng vẫn giữ được tinh thần văn hóa vàẩm thực truyền thống rất riêng	Mission	Sứ Mệnh	Making pizza by hand with premium ingredients, stable flavors and seafood dishes and attentive service. Creating experiences from simple dishes, creating flavors, creating expectations that come from the simple taste experience of a piece of delicious pizza	Làm pizza thủ công với chất lượng ôn định, hương vị hài hòa và phục vụ tận tâm. Tạo ra trải nghiệm từ mỗi hương vị, tạo ra sự kỳ vọng đến từ những điều đơn giản như một chiếc pizza ngon	Core Values	Giá Trị Cốt Lõi	We believe in the quality of handcrafted food, dedication in every meal and creating memorable experiences that customers remember. Every dish we serve must bring smiles to our diners and create unforgettable moments through simple but delicious meals	Chúng tôi tin vào chất lượng thủ công, sự tận tâm trong từng món ăn và tạo ra không gian ấm cúng nơi mọi gia đình có thể cũng nhau nếm những khoảnh khắc đáng nhớ qua bữa ăn ngon	Meet the Team	Gặp Gỡ Đội Ngũ	Hùng Nguyễn	Head Chef & Founder	Bếp Trưởng & Người Sáng Lập	With over 10 years of pizza-making experience, Hùng has trained and perfected the craft to create authentic pizza recipes while preserving traditional techniques combined with Vietnamese tastes	Với hơn 10 năm kinh nghiệm làm pizza, Hùng đã nghiên cứu và điều chỉnh công thức để tạo ra những chiếc pizza vừa giữ được tính thủy truyền thống vừa phù hợp với khẩu vị Việt Nam	/objects/images/d38de9b4-a435-49c3-a6fd-071449dde0b0	Mai Phương	Restaurant Manager	Quản Lý Nhà Hàng	Mai ensures every customer has a wonderful experience. She's always attentive to feedback and constantly improves service quality to create a cozy atmosphere for all families	Mai đảm bảo mỗi khách hàng đều có trải nghiệm tuyệt vời với nhà hàng. Cô luôn lắng nghe phản hồi và liên tục cải thiện chất lượng dịch vụ